import React, { useEffect, useState } from "react";
import { fetchMembers } from "./api";
import "./App.css";

function App() {
  const [members, setMembers] = useState([]);
  useEffect(() => {
    fetchMembers().then((members) => {
      setMembers(members);
    });
  }, []);

  return (
    <div>
      <h1>EmberJS Members</h1>
    </div>
  );
}

export default App;
